import { Theme } from '@radix-ui/themes';
import '@radix-ui/themes/styles.css';
import HomePage from './HomePage';

export default function App() {
    console.log("The javascript works!")
    return (
        <html>
            <body>
                <Theme
                    accentColor="cyan"
                    grayColor="gray"
                    panelBackground="solid"
                    scaling="100%"
                    radius="full"
                    >
                    <HomePage />
                </Theme>
            </body>
        </html>

    )
}
